INSERT INTO `v1_be1ad8e4ae3d4f352a5e7eb93d817a1a716b0926446369a60eb3be3bf686315b` VALUES (7, 2834, 91002, "青空の下で謁見", 40, "ペコリーヌとの出会い", 20063115, 1, 5118061, 8, 0, "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", 10118, 2, "フリーマーケット会場");
INSERT INTO `v1_be1ad8e4ae3d4f352a5e7eb93d817a1a716b0926446369a60eb3be3bf686315b` VALUES (7, 2835, 91002, "未来の騎空団\nマスコット？", 40, "マホとの出会い", 20063115, 1, 5118062, 8, 0, "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", 10118, 2, "フリーマーケット会場");
INSERT INTO `v1_be1ad8e4ae3d4f352a5e7eb93d817a1a716b0926446369a60eb3be3bf686315b` VALUES (7, 2837, 91002, "お嬢さまからの\n緊急依頼", 40, "アキノとの出会い", 20063115, 1, 5118063, 8, 0, "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", 10118, 2, "ランドソル市街地");
INSERT INTO `v1_be1ad8e4ae3d4f352a5e7eb93d817a1a716b0926446369a60eb3be3bf686315b` VALUES (18, 4108402, 91002, "黄金色の悩みごと", 40, "ジュンとの出会い", 20063115, 1, 5118064, 8, 0, "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", 10118, 2, "フリーマーケット会場");
INSERT INTO `v1_be1ad8e4ae3d4f352a5e7eb93d817a1a716b0926446369a60eb3be3bf686315b` VALUES (18, 4107402, 91002, "白熱！　格闘大会！", 40, "カオリとの出会い", 20063115, 1, 5118065, 8, 0, "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", 10118, 2, "フリーマーケット会場");
INSERT INTO `v1_be1ad8e4ae3d4f352a5e7eb93d817a1a716b0926446369a60eb3be3bf686315b` VALUES (16, 9000227, 91002, "祭り太鼓はオーエドの華", 40, "ニノンとの出会い", 20063115, 1, 5118066, 8, 1, "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", 10118, 2, "オーエド町");
INSERT INTO `v1_be1ad8e4ae3d4f352a5e7eb93d817a1a716b0926446369a60eb3be3bf686315b` VALUES (19, 2101181, 91002, "人気者は遅れて\nやってくる", 40, "スズナとの出会い", 20063115, 1, 5118067, 8, 0, "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", 10118, 3, "フリーマーケット会場");
INSERT INTO `v1_be1ad8e4ae3d4f352a5e7eb93d817a1a716b0926446369a60eb3be3bf686315b` VALUES (18, 4109402, 91002, "巫女・ミーツ・魔法少女", 40, "ナナカとの出会い", 20063115, 1, 5118068, 8, 0, "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", 10118, 3, "ランドソル市街地");
INSERT INTO `v1_be1ad8e4ae3d4f352a5e7eb93d817a1a716b0926446369a60eb3be3bf686315b` VALUES (18, 4305402, 91002, "ネズ耳は二度なくなる", 40, "キャル＆コッコロとの出会い", 20063115, 1, 5118069, 8, 0, "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", 10118, 3, "フリーマーケット会場");
INSERT INTO `v1_be1ad8e4ae3d4f352a5e7eb93d817a1a716b0926446369a60eb3be3bf686315b` VALUES (18, 4101402, 91002, "この出会いにカンパイ！", 40, "ユカリとの出会い", 20063115, 1, 5118070, 8, 0, "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", 10118, 3, "ランドソル市街地");
INSERT INTO `v1_be1ad8e4ae3d4f352a5e7eb93d817a1a716b0926446369a60eb3be3bf686315b` VALUES (18, 4106402, 91002, "陰陽アンサンブル", 40, "アオイとの出会い", 20063115, 1, 5118071, 8, 0, "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", 10118, 3, "ランドソル市街地");
INSERT INTO `v1_be1ad8e4ae3d4f352a5e7eb93d817a1a716b0926446369a60eb3be3bf686315b` VALUES (7, 2836, 91002, "運試し十番勝負！", 40, "シノブとの出会い", 20063115, 1, 5118072, 8, 1, "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", 10118, 3, "フリーマーケット会場");
INSERT INTO `v1_be1ad8e4ae3d4f352a5e7eb93d817a1a716b0926446369a60eb3be3bf686315b` VALUES (0, 0, 0, "彼女たちの新たな日常", 0, "オープニング", 20063115, 0, 5118600, 0, 0, 0, 10118, 1, 0);
